import React from 'react'
import Container from 'react-bootstrap/Container';
import styled from 'styled-components';
import logo from '../assets/images/logo.png'
import book from '../assets/images/book.png'
import Button from '@mui/material/Button';
import StarBorderIcon from '@mui/icons-material/StarBorder';
import Typography from '@mui/material/Typography';
import Fab from '@mui/material/Fab';
import rightbg from '../assets/images/right-bg.png';
import hero from '../assets/images/hero3.png';
import Skewright from './Skewright';
import Typewriter from "typewriter-effect";
import { useNavigate } from 'react-router-dom';


const Herosmall = () => {
    const Hero=styled.section`
        margin-top:64px;
        height: 40vh;
        position: relative;
        background-image:url(${hero});
        background-color:rgb(106,106,179,.5);
        background-size: 100%;
        background-repeat: no-repeat;
        ${'' /* background-position:right; */}
        .parent{
            display:flex;
            flex-wrap:wrap;
            flex-direction:row;
            .section{
                .part1{
                    
                }
                .part2{

                }
            }
        }
    `;

    const navigate = useNavigate();

  return (
    <Hero>
        <Container>
           <div className='parent'>
           <div className='section part1'></div>
           <div className='section part2'></div>
           </div>
        </Container>
    </Hero>
  )
}

export default Herosmall
